import React, {Component} from 'react';
import '../scss/home.scss'
class Home extends Component {
    render() {
        return (
            <div className='Home'>
               <h2>BEN VENUTO SU</h2>
               <h1>CONVERZIONE</h1>
            </div>
        );
    }
}

export default Home;
